  \"2016-03-17T20:52:06.197927\",\n\t\"name\": \"iowa-carbon-monoxide-hospitalizations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains case counts of Carbon
  Monoxide Hospitalizations in the state of Iowa. Case counts include unintentional
  fire-related poisoning, unintentional non-fire related poisoning, and undetermined
  source poisoning. Data are stratified by age group, sex, and county.  This data
  set is intended to provide data for the National Environmental Public Health Tracking
  Network, consistent with the guidance for creating carbon monoxide hospitalization
  Nationally Consistent Data Measures (NCDMs).   Small numbers suppression has been
  applied to data available to the public.\",\n\t\"license_title\": \"License Not
